import React from 'react';
import {useState} from 'react';


function Collapsible(title,content) {
    const [open, setOPen] = useState(false);
    const toggle = () => {
        setOPen(!open);
    };
    return (
        <div>
        <button onClick={toggle}>{title}</button>
        {open && (
        <div className="toggle">
            <h4>{content}</h4>
        </div>
        )}
        </div>
    );
}
export default Collapsible;
